Сегодня стартует одно из самых масштабных мероприятий в сфере воспитания — III Всероссийская детская премия «Новая философия воспитания»! 

Ключевая цель конкурса – выявить лучших советников директоров по воспитанию и взаимодействию с детскими общественными объединениями, муниципальных координаторов федерального проекта «Патриотическое воспитание граждан Российской Федерации» национального проекта «Образование», представителей педагогического и родительского сообществ, а также граждан Российской Федерации, внесших значительный вклад в воспитание подрастающего поколения на основе общероссийских духовно-нравственных ценностей. 

Конкурс проводится в рамках четырех основных и шести специальных номинаций: 

Основные номинации: 
🔸 «Навигатор детских открытий» (для советников, которые работают в школах);
🔸 «Навигатор профессиональных маршрутов» (для советников, которые работают в учреждениях СПО);
🔸 «Вдохновитель команды» (для муниципальных координаторов проекта);
🔸 «Навигатор моего сердца» (выбирается детским экспертным советом).

Специальные номинации: 
🔸 «Сердце Орлят» (для учителей начальных классов, реализующих программу «Орлята России»);
🔸 «Навигатор «Первых» (для руководителей первичных отделений «Движения Первых»);
🔸 «Лидер воспитательных преобразований» (для руководителей школ и учреждений СПО, деятельность которых создает благоприятные условия для обучения и развития обучающихся). 
🔸 «Навигатор детских возможностей» (для педагогов дополнительного образования). 
🔸 «Сообщество значимых взрослых» (для представителей родительского сообщества). 
🔸 «СВОй герой» (для военнослужащих РФ, принимавших участие в специальной военной операции, ветеранов боевых действий, ведущих просветительскую деятельность в общеобразовательных организациях).

Выдвинуть советника директора по воспитанию на III Всероссийскую детскую премию «Новая философия воспитания» могут сами школьники и студенты СПО. Для этого нужно: 
🔸 определить номинацию; 
🔸 создать пост с ВК-клипом «Один день из жизни советника»; 
🔸 дополнить пост сопроводительным текстом, который отражает активное участие советника в вашей школьной/ студенческой жизни; 
🔸 опубликовать его в официальной группе образовательного учреждения в социальной сети «ВКонтакте» с хештегами #НавигаторыДетства #лучший_советник2024 #Росдетцентр; 
🔸 заполнить Заявку в Яндекс.Форме: https://clck.ru/3DBDs3

Также в рамках III Всероссийской детской премии «Новая философия воспитания» советники по воспитанию смогут номинировать муниципального координатора в номинации «Вдохновитель команды». Для этого потребуется: 
🔸 создать пост с ВК-клипом «Один день из жизни 
муниципального координатора» совместно с советниками своего муниципалитета; 
🔸 дополнить пост сопроводительным текстом, отражающий активное участие муниципального координатора в вашей жизни; 
🔸 опубликовать его в муниципальной или региональной группе «Навигаторы детства» в социальной сети «ВКонтакте» с хештегами #НавигаторыДетства #лучший_МК2024 #Росдетцентр 
🔸 заполнить Заявку в Яндекс.Форме: https://clck.ru/3DBDs3

Для того, чтобы номинировать участников по специальным номинациям советникам потребуется заполнить Заявку в Яндекс.Форме: https://clck.ru/3DBDs3

Согласия на обработку персональных данных и распространение доступны по ссылке: https://disk.yandex.ru/d/rE60bMpt-a97dg

Конкурс пройдет в два тура: региональный (с 1 октября 
по 17 октября) и всероссийский (с 23 октября по 12 ноября). Очный тур пройдет в декабре месяце в г. Москве. В этом году премия охватывает все 89 субъектов РФ, впервые участвует город Байконур. Заявки на конкурс принимаются до 30 сентября 2024 года.

Награждение победителей пройдет в рамках форума «Новая философия воспитания».

Вместе создаем будущее России!

